import React from "react";
import "../styles/Logo.css";
import LogoImage from "../images/Logo.png"

const Logo =()=>{
    return(

        <div className="contenedor-Logo">
        
        <img src={LogoImage} alt="Logo de la tienda" className="Logo" />
        </div>
    )
}

export default Logo;


